Dear Sir/Madam,


Greetings from GMPayments, the leading payment solution provider operating worldwide. We are an Asia based and fast-growing company which maintains trustworthy for internet-payment (e-Commerce) processing services.  


GMPayments offers extended scope of custom tailored services which include the most popular payment solutions worldwide, such as Visa , MasterCard , American Express and JCB.
 
Merchant categories that we mostly cooperate with but not limited to:


*eCommerce BUSINESS:

 •  PCI-DSS Level 1 Compliant Payment Gateway ;

•  Member of Visa ,MasterCard and American Express  ;

•  iDeal , Sofort Banking , Paysafecard , Giropay etc APMs supported ; 



•  Multi-Currencies Payment Processing-  CNY , USD ,HKD, EUR , GBP;

•  Multi-Currencies of Settlement : HKD , USD , EUR , GBP , JYP

•  Pre-Authorization  ;

•  Subscription billing solutions ;


•  Competitive Pricing: 1.5% to 5%;


•  3D Secure / Non 3D  ;

•  Coded & Miscoded


•  Branded & Own billing descriptor ( We understand that for high turnover merchant , multiple MIDs is needed to reduce charegbacks )

•  Seamless checkout experience on your website ( Direct API may require you're PCI DSS compliant ) ;









Email us and we will be glad to discuss your exact business case.  Accept online payment now http://www.GMPayments.com/sign-up.


Kind Regards,
GMPayments Team
Website: http://www.GMPayments.com/

